<template>
  <div>
      <h1 class="heading">Hallo und Willkommen!</h1>
      <div class="heading" v-for="person in camFeed">
          {{person.first_name}}
        <img class="responsive" v-bind:src="'data:image/png;base64,' + toImage(person.image)" />
        <button @click="$emit('pass-on', addTimestamp(person))">Das bin ich!</button>
      </div>
  </div>
</template>

<script>
import io from 'socket.io-client';

export default {
    name: "cam-feed",
    data() {
        return {
            socket: null,
            eventBusUrl: "http://localhost:8080",
            camFeed: [
                {
                    person: "Max",
                    image: ""
                }
            ],
            window: null,
        }
    },
    mounted() {
        this.window = window
        this.createNotificationConnection();
    },
    methods: {
        addTimestamp (blub) {
            var currentdate = new Date(); 
            var datetime = currentdate.getDate() + "/"
                + (currentdate.getMonth()+1)  + "/" 
                + currentdate.getFullYear() + " @ "  
                + currentdate.getHours() + ":"  
                + currentdate.getMinutes() + ":" 
                + currentdate.getSeconds();
            blub["Timestamp"] = datetime
            return blub
        },
        createNotificationConnection: function () {
            this.socket = io(this.eventBusUrl);
            this.socket.on(`notifications_server`, function(data) {
                let json = JSON.parse(data);
                // console.log(json);
                this.camFeed.unshift(json);
            }.bind(this));
        },
        toImage: function(string) {
            string = string.replace(/\r\n/g,"\n");
            var utftext = "";

            for (var n = 0; n < string.length; n++) {

                var c = string.charCodeAt(n);

                if (c < 128) {
                    utftext += String.fromCharCode(c);
                }
                else if((c > 127) && (c < 2048)) {
                    utftext += String.fromCharCode((c >> 6) | 192);
                    utftext += String.fromCharCode((c & 63) | 128);
                }
                else {
                    utftext += String.fromCharCode((c >> 12) | 224);
                    utftext += String.fromCharCode(((c >> 6) & 63) | 128);
                    utftext += String.fromCharCode((c & 63) | 128);
                }

            }

            return utftext;
        }
    }
};
</script>

<style lang="scss" scoped>

.heading {
    text-align: center
}

.responsive {
  width: 80%;
  height: auto;
}

</style>
